import React from "react";

const PopularPosts = ({ post }) => {
  return (
    <div className="card" onClick={() => navigate(`/post/${post._id}`)}>
      <div className="content">
        <div className="header">{post.title}</div>
      </div>
    </div>
  );
};

export default PopularPosts;
